translated_text:
Lao: ລົດອີກ 300 ຄັນ ລວມທັງໝົດເປັນ 1,300 ຄັນ ເພື່ອບັນເທົາຄວາມແອອັດ. 
English: Lao PDR: 300,000,000 kip (1,300,000,000 US dollars);
Chinese: 人民币300亿元(约合人民币1,300亿美元);
Japanese: 円300億円(約合300億美元);
Russian: 300 thousand roubles (300 thousand rubles);
Polish: 300 złoty (300 złoty);
Turkish: 300 TL (300 TL);
Vietnamese: 300
